import React from 'react';
import './App.css';
import Card from './Card.js';
import CardList from './CardList';

class App extends React.Component{
  constructor(){
    super();
    this.state = {
      foods: []
    }
  }

  componentDidMount(){
    fetch("https://food-calorie-data-search.p.rapidapi.com/api/search?keyword=apple", 
          {
	        "method": "GET",
	        "headers": {
		                    "x-rapidapi-host": "food-calorie-data-search.p.rapidapi.com",
		                    "x-rapidapi-key": "2da75ce1cfmsh26fa14825a18dd4p16d23bjsn59e64460077f"
	                    }
          }
    )
    .then(response => {
	    return response.json()
    })
    .then(result => {
      console.log(result[0].energ_kcal);
      this.setState({foods: result[0]})
    })
    .catch(err => {
    	console.log(err);
    });
  }

  render(){
    return(
      <Card foodP={this.state.foods}/>
    )
  }
}

export default App;
